import{_ as e,f as r,o,an as t}from"./chunks/framework.CFMQV-X7.js";const b=JSON.parse('{"title":"文件夹结构","description":"","frontmatter":{},"headers":[],"relativePath":"zh_CN/getting-started/directory-structure.md","filePath":"zh_CN/getting-started/directory-structure.md","lastUpdated":1754706920000}'),i={name:"zh_CN/getting-started/directory-structure.md"};function l(s,a,c,d,h,p){return o(),r("div",null,a[0]||(a[0]=[t('<h1 id="文件夹结构" tabindex="-1">文件夹结构 <a class="header-anchor" href="#文件夹结构" aria-label="Permalink to “文件夹结构”">​</a></h1><nav class="table-of-contents"><ul><li><a href="#简介">简介</a></li><li><a href="#根目录">根目录</a><ul><li><a href="#app-目录">app 目录</a></li><li><a href="#bootstrap-目录">bootstrap 目录</a></li><li><a href="#config-目录">config 目录</a></li><li><a href="#database-目录">database 目录</a></li><li><a href="#public-目录">public 目录</a></li><li><a href="#resources-目录">resources 目录</a></li><li><a href="#routes-目录">routes 目录</a></li><li><a href="#storage-目录">storage 目录</a></li><li><a href="#tests-目录">tests 目录</a></li></ul></li><li><a href="#app-目录-1">app 目录</a><ul><li><a href="#console-目录">console 目录</a></li><li><a href="#http-目录">http 目录</a></li><li><a href="#grpc-目录">grpc 目录</a></li><li><a href="#models-目录">models 目录</a></li><li><a href="#providers-目录">providers 目录</a></li></ul></li></ul></nav><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to “简介”">​</a></h2><p>默认的文件结构可以使你更好的开始项目推进，你也可以自由的新增文件夹，但默认文件夹不要修改。</p><h2 id="根目录" tabindex="-1">根目录 <a class="header-anchor" href="#根目录" aria-label="Permalink to “根目录”">​</a></h2><h3 id="app-目录" tabindex="-1">app 目录 <a class="header-anchor" href="#app-目录" aria-label="Permalink to “app 目录”">​</a></h3><p><code>app</code> 包含了程序的核心代码。 程序中几乎所有的逻辑都将在这个文件夹中。</p><h3 id="bootstrap-目录" tabindex="-1">bootstrap 目录 <a class="header-anchor" href="#bootstrap-目录" aria-label="Permalink to “bootstrap 目录”">​</a></h3><p><code>bootstrap</code> 目录包含了框架的启动文件 <code>app.go</code>。</p><h3 id="config-目录" tabindex="-1">config 目录 <a class="header-anchor" href="#config-目录" aria-label="Permalink to “config 目录”">​</a></h3><p><code>config</code> 目录包含了应用程序的所有配置文件。 最好把这些文件都浏览一遍，并熟悉所有可用的配置。</p><h3 id="database-目录" tabindex="-1">database 目录 <a class="header-anchor" href="#database-目录" aria-label="Permalink to “database 目录”">​</a></h3><p><code>database</code> 目录包含了数据库迁移文件。</p><h3 id="public-目录" tabindex="-1">public 目录 <a class="header-anchor" href="#public-目录" aria-label="Permalink to “public 目录”">​</a></h3><p><code>public</code> 目录包含一些静态资源，如图像、证书等。</p><h3 id="resources-目录" tabindex="-1">resources 目录 <a class="header-anchor" href="#resources-目录" aria-label="Permalink to “resources 目录”">​</a></h3><p><code>resources</code> 目录包含你的<a href="./../the-basics/views.html">视图</a>，以及原始的、未编译的资源文件，例如 CSS 或 JavaScript。</p><h3 id="routes-目录" tabindex="-1">routes 目录 <a class="header-anchor" href="#routes-目录" aria-label="Permalink to “routes 目录”">​</a></h3><p><code>routes</code> 目录包含应用程序的所有路由定义。</p><h3 id="storage-目录" tabindex="-1">storage 目录 <a class="header-anchor" href="#storage-目录" aria-label="Permalink to “storage 目录”">​</a></h3><p><code>storage</code> 目录包含 <code>logs</code> 等目录，<code>logs</code> 目录包含应用程序的日志文件。</p><h3 id="tests-目录" tabindex="-1">tests 目录 <a class="header-anchor" href="#tests-目录" aria-label="Permalink to “tests 目录”">​</a></h3><p><code>tests</code> 目录包含你的自动化测试。</p><h2 id="app-目录-1" tabindex="-1">app 目录 <a class="header-anchor" href="#app-目录-1" aria-label="Permalink to “app 目录”">​</a></h2><h3 id="console-目录" tabindex="-1">console 目录 <a class="header-anchor" href="#console-目录" aria-label="Permalink to “console 目录”">​</a></h3><p><code>console</code> 目录包含应用程序所有自定义的 <code>Artisan</code> 命令，与控制台引导文件 <code>kernel.go</code>，可以在这个文件中注册<a href="./../digging-deeper/task-scheduling.html">任务</a></p><h3 id="http-目录" tabindex="-1">http 目录 <a class="header-anchor" href="#http-目录" aria-label="Permalink to “http 目录”">​</a></h3><p><code>http</code> 目录包含了控制器、中间件等，几乎所有通过 Web 进入应用的请求处理都在这里进行。</p><h3 id="grpc-目录" tabindex="-1">grpc 目录 <a class="header-anchor" href="#grpc-目录" aria-label="Permalink to “grpc 目录”">​</a></h3><p><code>grpc</code> 目录包含了控制器、中间件等，几乎所有通过 Grpc 进入应用的请求处理都在这里进行。</p><h3 id="models-目录" tabindex="-1">models 目录 <a class="header-anchor" href="#models-目录" aria-label="Permalink to “models 目录”">​</a></h3><p><code>models</code> 目录包含所有数据模型。</p><h3 id="providers-目录" tabindex="-1">providers 目录 <a class="header-anchor" href="#providers-目录" aria-label="Permalink to “providers 目录”">​</a></h3><p><code>providers</code> 目录包含程序中所有的 <a href="./../architecture-concepts/service-providers.html">服务提供者</a>。 服务提供者通过绑定服务、注册事件或执行任何其他任务来引导应用程序以应对传入的请求。</p>',34)]))}const f=e(i,[["render",l]]);export{b as __pageData,f as default};
